import React from 'react';
import { Link } from 'react-router-dom';
import { useState } from 'react';
import '../styles/index.css';

export default function Navbar() {
  const [open, setOpen] = useState(false);

  return (
    <header className="rah-navbar">
      <div className="container nav-inner">
        <Link to="/" className="nav-logo">RAH</Link>

        <nav className="nav-links" aria-hidden={open ? 'false' : 'true'}>
          <Link to="/home">Home</Link>
          <Link to="/registration">Registration</Link>
          <Link to="/digital-id">Digital ID</Link>
          <Link to="/check-in">Check-In</Link>
          <Link to="/mobile-app">Mobile App</Link>
          <Link to="/ai-detection">AI Detection</Link>
          <Link to="/police-dashboard">Police</Link>
          <Link to="/analytics">Analytics</Link>
          <Link to="/about">About</Link>
          <Link to="/contact">Contact</Link>
        </nav>

        <button className="nav-toggle" aria-label="Toggle menu" onClick={() => setOpen(!open)}>
          {open ? 'Close' : 'Menu'}
        </button>
      </div>

      {open && (
        <div className="container mobile-menu">
          <Link to="/home" onClick={() => setOpen(false)}>Home</Link>
          <Link to="/registration" onClick={() => setOpen(false)}>Registration</Link>
          <Link to="/digital-id" onClick={() => setOpen(false)}>Digital ID</Link>
          <Link to="/check-in" onClick={() => setOpen(false)}>Check-In</Link>
          <Link to="/mobile-app" onClick={() => setOpen(false)}>Mobile App</Link>
          <Link to="/ai-detection" onClick={() => setOpen(false)}>AI Detection</Link>
          <Link to="/police-dashboard" onClick={() => setOpen(false)}>Police</Link>
          <Link to="/analytics" onClick={() => setOpen(false)}>Analytics</Link>
          <Link to="/about" onClick={() => setOpen(false)}>About</Link>
          <Link to="/contact" onClick={() => setOpen(false)}>Contact</Link>
        </div>
      )}
    </header>
  );
}
